import pandas as pd

# list of file names
file_names = ['/content/karimnagar_2019.csv','/content/karimnagar_2020.csv',
              '/content/karimnagar_2021.csv','/content/karimnagar_2022.csv',
              '/content/Karimnagar_2018.csv']

# create an empty list to store DataFrames
dfs = []

# loop through the list of file names and read each CSV file into a DataFrame
for file_name in file_names:
    df = pd.read_csv(file_name)
    dfs.append(df)

# concatenate all DataFrames in the list to form a new DataFrame
Karimnagar_dataset= pd.concat(dfs, ignore_index=True)
Karimnagar_dataset.to_csv(f'Karimnagar_dataset.csv', index=False)

